INSERT INTO rs_ceds7_sc.Ref_Lea_Type( Ref_Lea_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Regular public school district that is NOT a component of a supervisory union', 'Regular_Not_In_Supervisory_Union', 'A local government administrative authority which governs the education system at a specified local level on behalf of the public and the state and is NOT a component of a supervisory union.', null, 1.00 ); 
INSERT INTO rs_ceds7_sc.Ref_Lea_Type( Ref_Lea_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Regular public school district that is a component of a supervisory union', 'Regular_In_Supervisory_Union', 'A local government administrative authority which governs the education system at a specified local level on behalf of the public and the state and is a component of a supervisory union.', null, 2.00 ); 
INSERT INTO rs_ceds7_sc.Ref_Lea_Type( Ref_Lea_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, ' Supervisory Union', 'Supervisory_Union', 'An administrative center or county superintendent''s office serving as the administrative center.', null, 3.00 ); 
INSERT INTO rs_ceds7_sc.Ref_Lea_Type( Ref_Lea_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 4, 'Specialized Public School District', 'Specialized_Public_School_District', 'A school district that operates one or more schools that are designed for a specific educational need or purpose.', null, 4.00 ); 
INSERT INTO rs_ceds7_sc.Ref_Lea_Type( Ref_Lea_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 5, 'Service Agency', 'Service_Agency', 'An agency that does not operate schools, instead it provides specialized educational services (such as career and technical education) or related services (such as services in IE_Ps) to other education agencies that the agencies cannot readily provide for themselves.', null, 5.00 ); 
INSERT INTO rs_ceds7_sc.Ref_Lea_Type( Ref_Lea_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 6, 'State Operated Agency', 'State_Operated_Agency', 'An organization overseen by a state agency that operates schools or programs that provide public elementary and/or secondary level instruction.', null, 6.00 ); 
INSERT INTO rs_ceds7_sc.Ref_Lea_Type( Ref_Lea_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 7, 'Federal Operated Agency', 'Federal_Operated_Agency', 'An organization overseen by a federal agency that operates schools or programs that provide public elementary and/or secondary level instruction.', null, 7.00 ); 
INSERT INTO rs_ceds7_sc.Ref_Lea_Type( Ref_Lea_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 8, 'Other Local Education Agencies', 'Other', 'Category for an agency providing elementary or secondary instruction or support services to use when one of the other types defined in CEDS is not appropriate.', null, 8.00 ); 
