INSERT INTO rs_ceds7_sc.Ref_Learning_Resource_Access_Rights_Url( Ref_Learning_Resource_Access_Rights_Url_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Free Access', 'Free_Access', 'The right to view and/or download material without financial, registration, or excessive advertising barriers.  [<a href=https://ceds.ed.gov/element/001561#_free_access>https://ceds.ed.gov/element/001561#_Free_Access</a>]', null, 0.00 ); 
INSERT INTO rs_ceds7_sc.Ref_Learning_Resource_Access_Rights_Url( Ref_Learning_Resource_Access_Rights_Url_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Free Access with Registration', 'Free_Access_With_Registration', 'The right to view and/or download material without financial barriers but users are required to register or experience some other low-barrier to use.  [<a href=https://ceds.ed.gov/element/001561#_free_access_with_registration>https://ceds.ed.gov/element/001561#_Free_Access_With_Registration</a>]', null, 1.00 ); 
INSERT INTO rs_ceds7_sc.Ref_Learning_Resource_Access_Rights_Url( Ref_Learning_Resource_Access_Rights_Url_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'Limited Free Access', 'Limited_Free_Access', 'Some material is available for viewing and/or downloading but most material tends to be accessible through other means.  [<a href=https://ceds.ed.gov/element/001561#_limited_free_access>https://ceds.ed.gov/element/001561#_Limited_Free_Access</a>]', null, 3.00 ); 
INSERT INTO rs_ceds7_sc.Ref_Learning_Resource_Access_Rights_Url( Ref_Learning_Resource_Access_Rights_Url_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 4, 'Available for Purchase', 'Available_For_Purchase', 'The right to view, keep, and/or download material upon payment of a one-time fee.  [<a href=https://ceds.ed.gov/element/001561#_available_for_purchase>https://ceds.ed.gov/element/001561#_Available_For_Purchase</a>]', null, 5.00 ); 
INSERT INTO rs_ceds7_sc.Ref_Learning_Resource_Access_Rights_Url( Ref_Learning_Resource_Access_Rights_Url_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 5, 'Available by Subscription', 'Available_By_Subscription', 'The right to view and/or download material, often for a set period of time, by way of a financial agreement between rights holders and authorized users.  [<a href=https://ceds.ed.gov/element/001561#_available_by_subscription>https://ceds.ed.gov/element/001561#_Available_By_Subscription</a>]', null, 7.00 ); 
INSERT INTO rs_ceds7_sc.Ref_Learning_Resource_Access_Rights_Url( Ref_Learning_Resource_Access_Rights_Url_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 6, 'Publisher Defined', 'Publisher_Defined', 'Publisher defined conditions that govern the user?s ability to access a learning resource.', null, 9.00 ); 
