INSERT INTO rs_ceds7_sc.ref_apip_interaction_type( Ref_APIP_Interaction_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Custom Interaction', 'Custom_Interaction', 'The custom interaction provides an opportunity for extensibility of this specification to include support for interactions not currently documented.', null, 1.00 ); 
INSERT INTO rs_ceds7_sc.ref_apip_interaction_type( Ref_APIP_Interaction_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Drawing Interaction', 'Drawing_Interaction', 'The drawing interaction allows the candidate to use a common set of drawing tools to modify a given graphical image (the canvas). It must be bound to a response variable with base-type file and single cardinality. The result is a file in the same format as the original image.', null, 2.00 ); 
INSERT INTO rs_ceds7_sc.ref_apip_interaction_type( Ref_APIP_Interaction_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'Gap Match Interaction', 'Gap_Match_Interaction', 'A gap match interaction contains a number gaps that the candidate can fill from an associated set of choices. The candidate must be able to review the content with the gaps filled in context, as indicated by their choices.', null, 3.00 ); 
INSERT INTO rs_ceds7_sc.ref_apip_interaction_type( Ref_APIP_Interaction_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 4, 'Match Interaction', 'Match_Interaction', 'A match interaction presents candidates with two sets of choices and allows them to create associates between pairs of choices in the two sets, but not between pairs of choices in the same set. Further restrictions can still be placed on the allowable associations using the match_Max attribute of the choices.', null, 4.00 ); 
INSERT INTO rs_ceds7_sc.ref_apip_interaction_type( Ref_APIP_Interaction_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 5, 'Graphic Gap Match Interaction', 'Graphic_Gap_Match_Interaction', 'A graphic gap-match interaction is a graphical interaction with a set of gaps that are defined as areas (hotspots) of the graphic image and an additional set of gap choices that are defined outside the image. The candidate must associate the gap choices with the gaps in the image and be able to review the image with the gaps filled in context, as indicated by their choices. Care should be taken when designing these interactions to ensure that the gaps in the image are a suitable size to receive the required gap choices. It must be clear to the candidate which hotspot each choice has been associated with. When associated, choices must appear wholly inside the gaps if at all possible and, where overlaps are required, should not hide each other completely. If the candidate indicates the association by positioning the choice over the gap (e.g., drag and drop) the system should ''snap'' it to the nearest position that satisfies these requirements.', null, 5.00 ); 
INSERT INTO rs_ceds7_sc.ref_apip_interaction_type( Ref_APIP_Interaction_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 6, 'Hotspot Interaction', 'Hotspot_Interaction', 'A hotspot interaction is a graphical interaction with a corresponding set of choices that are defined as areas of the graphic image. The candidate''s task is to select one or more of the areas (hotspots). The hotspot interaction should only be used when the spatial relationship of the choices with respect to each other (as represented by the graphic image) is important to the needs of the item. Otherwise, choice_Interaction should be used instead with separate material for each option.', null, 6.00 ); 
INSERT INTO rs_ceds7_sc.ref_apip_interaction_type( Ref_APIP_Interaction_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 7, 'Graphic Order Interaction', 'Graphic_Order_Interaction', 'A graphic order interaction is a graphic interaction with a corresponding set of choices that are defined as areas of the graphic image. The candidate''s task is to impose an ordering on the areas (hotspots). The order hotspot interaction should only be used when the spatial relationship of the choices with respect to each other (as represented by the graphic image) is important to the needs of the item. Otherwise, order_Interaction should be used instead with separate material for each option.', null, 7.00 ); 
INSERT INTO rs_ceds7_sc.ref_apip_interaction_type( Ref_APIP_Interaction_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 8, 'Graphic Associate Interaction', 'Graphic_Associate_Interaction', 'A graphic associate interaction is a graphic interaction with a corresponding set of choices that are defined as areas of the graphic image. The candidate''s task is to associate the areas (hotspots) with each other. The graphic associate interaction should only be used when the graphical relationship of the choices with respect to each other (as represented by the graphic image) is important to the needs of the item. Otherwise, associate_Interaction should be used instead with separate Material for each option.\n_Slider_Interaction -- The slider interaction presents the candidate with a control for selecting a numerical value between a lower and upper bound. It must be bound to a response variable with single cardinality with a base-type of either integer or float.', null, 8.00 ); 
INSERT INTO rs_ceds7_sc.ref_apip_interaction_type( Ref_APIP_Interaction_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 9, 'Choice Interaction', 'Choice_Interaction', 'The choice interaction presents a set of choices to the candidate. The candidate''s task is to select one or more of the choices, up to a maximum of max_Choices. The interaction is always initialized with no choices selected.', null, 9.00 ); 
INSERT INTO rs_ceds7_sc.ref_apip_interaction_type( Ref_APIP_Interaction_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 10, 'Inline Choice Interaction', 'Inline_Choice_Interaction', 'A inline choice is an inline_Interaction that presents the user with a set of choices, each of which is a simple piece of text. The candidate''s task is to select one of the choices. Unlike the choice_Interaction, the delivery engine must allow the candidate to review their choice within the context of the surrounding text.', null, 10.00 ); 
INSERT INTO rs_ceds7_sc.ref_apip_interaction_type( Ref_APIP_Interaction_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 11, 'Media Interaction', 'Media_Interaction', 'The media interaction allows more control over the way the candidate interacts with a time-based media object and allows the number of times the media object was experienced to be reported in the value of the associated response variable, which must be of base-type integer and single cardinality.', null, 11.00 ); 
INSERT INTO rs_ceds7_sc.ref_apip_interaction_type( Ref_APIP_Interaction_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 12, 'Hottext Interaction', 'Hottext_Interaction', 'The hottext interaction presents a set of choices to the candidate represented as selectable runs of text embedded within a surrounding context, such as a simple passage of text. Like choice_Interaction, the candidate''s task is to select one or more of the choices, up to a maximum of max_Choices. The interaction is initialized from the default_Value of the associated response variable, a NULL value indicating that no choices are selected (the usual case).', null, 12.00 ); 
INSERT INTO rs_ceds7_sc.ref_apip_interaction_type( Ref_APIP_Interaction_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 13, 'Order Interaction', 'Order_Interaction', 'In an order interaction the candidate''s task is to reorder the choices, the order in which the choices are displayed initially is significant. By default the candidate''s task is to order all of the choices but a subset of the choices can be requested using the max_Choices and min_Choices attributes. When specified the candidate must select a subset of the choices and impose an ordering on them.', null, 13.00 ); 
INSERT INTO rs_ceds7_sc.ref_apip_interaction_type( Ref_APIP_Interaction_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 14, 'Position Object Interaction', 'Position_Object_Interaction', 'The position object interaction consists of a single image which must be positioned on another graphic image (the stage) by the candidate. Like select_Point_Interaction, the associated response may have an area_Mapping that scores the response on the basis of comparing it against predefined areas but the delivery engine must not indicate these areas of the stage. Only the actual position(s) selected by the candidate shall be indicated.', null, 14.00 ); 
INSERT INTO rs_ceds7_sc.ref_apip_interaction_type( Ref_APIP_Interaction_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 15, 'Text Entry Interaction', 'Text_Entry_Interaction', 'A text_Entry interaction obtains a simple piece of text from the candidate. Like inline_Choice_Interaction, the delivery engine must allow the candidate to review their choice within the context of the surrounding text.', null, 15.00 ); 
INSERT INTO rs_ceds7_sc.ref_apip_interaction_type( Ref_APIP_Interaction_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 16, 'Extended Text Interaction', 'Extended_Text_Interaction', 'An extended text interaction allows the candidate to enter an extended amount of text.', null, 16.00 ); 
INSERT INTO rs_ceds7_sc.ref_apip_interaction_type( Ref_APIP_Interaction_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 17, 'End Attempt Interaction', 'End_Attempt_Interaction', 'The end attempt interaction is a special type of interaction which allows item authors to provide the candidate with control over the way in which the candidate terminates an attempt. The candidate can use the interaction to terminate the attempt (triggering response processing) immediately, typically to request a hint. It must be bound to a response variable with base-type boolean and single cardinality.', null, 17.00 ); 
INSERT INTO rs_ceds7_sc.ref_apip_interaction_type( Ref_APIP_Interaction_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 18, 'Upload Interaction', 'Upload_Interaction', 'The upload interaction allows the candidate to upload a pre-prepared file representing their response. It must be bound to a response variable with base-type file and single cardinality.', null, 18.00 ); 
INSERT INTO rs_ceds7_sc.ref_apip_interaction_type( Ref_APIP_Interaction_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 19, 'Associate Interaction', 'Associate_Interaction', 'An associate interaction presents candidates with a number of choices and allows them to create associations between them.', null, 19.00 ); 
