INSERT INTO rs_ceds7_sc.ref_attendance_status( Ref_Attendance_Status_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Excused Absence', 'Excused_Absence', 'Not present but is temporarily excused from attendance because the person is: 1) is ill and attendance would endanger his or her health or the health of others; 2) has an immediate family member who is seriously ill or has died; 3) is observing a recognized religious holiday of his or her faith; or 4) is otherwise excused in accordance with policies.', null, 4.00 ); 
INSERT INTO rs_ceds7_sc.ref_attendance_status( Ref_Attendance_Status_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'Unexcused Absence', 'Unexcused_Absence', 'Not present without acceptable cause or authorization.', null, 6.00 ); 
