INSERT INTO rs_ceds7_sc.ref_attendance_status( Ref_Attendance_Status_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 5, 'Early Departure', 'Early_Departure', 'Leaves before the official close of the daily session. Reasons may include a special activity for curricular enrichment, doctor''s appointment, and family emergency. State, local, and school regulations may distinguish excused and unexcused early departures. When officially approved on a regular basis, early departures immediately prior to the close of the session are considered to be released time.', null, 10.00 ); 
