INSERT INTO rs_ceds7_sc.ref_credential_assessment_method_type( Ref_Credential_Assessment_Method_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Artifact', 'Artifact', 'A work or product created to be persistent in some medium. Artifact includes, but is not limited to, an academic paper, video documentary, computer software, music composition, choreography, novel, short story, journal article, news article, report, lesson plan, product design, manufactured product, etc. Methods of evaluation may include multiple evaluators either individually or as an expert panel using general criteria or more structured rubrics whose scores are combined, etc. Criteria and methods of evaluation are often very similar to those for assessing a performance, without the facets specific to a live performance.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_credential_assessment_method_type( Ref_Credential_Assessment_Method_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Exam', 'Exam', 'A mix of scored items presented in fixed or open response formats.  Exams may be human- or machine-scored and include, but are not limited to, multiple choice, true-false, written essay, short-answer, fill-in or oral response formats that could include measurements of reasoning, problem-solving, critical thinking.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_credential_assessment_method_type( Ref_Credential_Assessment_Method_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'Performance', 'Performance', 'A demonstration or performance that is usually assessed while the performance is taking place or as recorded for assessment purposes after the performance.  Performance includes, but is not limited to, dance, music, teaching, acting, medical procedures, truck driving, manufacturing production, etc. Criteria include the categories and benchmarks on which the performance is assessed. Methods of evaluation can include multiple evaluators either individually or as an expert panel using general criteria or more structured rubrics whose scores are combined.', null, null ); 
