INSERT INTO rs_ceds7_sc.ref_ctdl_organization_type( Ref_CTDL_Organization_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Business', 'Business', 'An organization that primarily sells products or services and employs one or more individuals.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ctdl_organization_type( Ref_CTDL_Organization_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'Business or Industry Association', 'Business_Association', 'A membership organization primarily engaged in promoting the interests of their business members and providing them with services that may involve the provision of education and credentialing services.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ctdl_organization_type( Ref_CTDL_Organization_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 4, 'Certification Body', 'Certification_Body', 'An independent, third-party organization that operates a certification program. A certification body may or may not be governmental, and may or may not have regulatory authority.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ctdl_organization_type( Ref_CTDL_Organization_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 5, 'Four-Year College', 'Four_Year', 'Authorized postsecondary institution that primarily offers bachelor or higher degrees, but may also award associate degrees.  Includes free-standing medical, law or other first-professional schools, schools that offer postbaccalaureate certificates only, those that offer graduate programs only, etc.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ctdl_organization_type( Ref_CTDL_Organization_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 6, 'Government Agency', 'Government', 'An organization in the public sector at the federal, state or local levels.  Includes quasi-governmental organizations, special districts (e.g., libraries), corrections organizations, etc., except college and school districts. Is also responsible for the oversight and administration of specific functions other than the military services.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ctdl_organization_type( Ref_CTDL_Organization_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 7, 'High School', 'High_School', 'A secondary school providing instruction and educational services that do not focus primarily on career and technical education or alternative education.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ctdl_organization_type( Ref_CTDL_Organization_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 8, 'Labor Union', 'Labor_Union', 'A membership organization of workers formed for the purpose of advancing its members'' interests in respect to wages, benefits, and working conditions.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ctdl_organization_type( Ref_CTDL_Organization_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 9, 'Magnet/_Competitive Admissions School', 'Magnet', 'A public school offering special instruction and programs not available elsewhere, designed to attract a more diverse student body from throughout a school district.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ctdl_organization_type( Ref_CTDL_Organization_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 10, 'Military', 'Military', 'The armed services of a government entity.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ctdl_organization_type( Ref_CTDL_Organization_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 11, 'Alternative/_Non-Traditional School', 'Non_Traditional', 'A secondary school that: 1) addresses needs of students which cannot typically be met in a regular school; 2) provides nontraditional education; and 3) falls outside of the categories of regular, magnet/special program emphasis, or career and technical education.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ctdl_organization_type( Ref_CTDL_Organization_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 12, 'Postsecondary Educational Institution', 'Postsecondary', 'An organization such as a college or university: (1) whose sole purpose is to provide postsecondary education defined as the provision of a formal instructional program whose curriculum is designed primarily for students who are beyond the compulsory age for high school and (2) has the authority to award degrees. This includes programs whose purpose is academic, vocational, and continuing professional education.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ctdl_organization_type( Ref_CTDL_Organization_Type_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 13, 'Primarily Online', 'Primarily_Online', 'An organization that primarily operates online.', null, null ); 
