INSERT INTO rs_ceds7_sc.ref_financial_account_fund_classification( Ref_Financial_Account_Fund_Classification_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 6, 'Enterprise Funds', '6', 'Enterprise Funds financial account.', null, 6.00 ); 
INSERT INTO rs_ceds7_sc.ref_financial_account_fund_classification( Ref_Financial_Account_Fund_Classification_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 7, 'Internal Service Funds', '7', 'Internal Service Funds financial account.', null, 7.00 ); 
INSERT INTO rs_ceds7_sc.ref_financial_account_fund_classification( Ref_Financial_Account_Fund_Classification_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 8, 'Trust Funds', '8', 'Trust Funds financial account.', null, 8.00 ); 
