INSERT INTO rs_ceds7_sc.ref_ipeds_natural_expense( Ref_IPEDS_Natural_Expense_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Benefits', 'Benefits', 'Cash contributions in the form of supplementary or deferred compensation other than salary. Excludes the employee''s contribution. Employee fringe benefits include retirement plans, social security taxes, medical/dental plans, guaranteed disability income protection plans, tuition plans, housing plans, unemployment compensation plans, group life insurance plans, worker''s compensation plans, and other benefits in-kind with cash options.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipeds_natural_expense( Ref_IPEDS_Natural_Expense_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Depreciation', 'Depreciation', 'The allocation or distribution of the cost of capital assets, less any salvage value, to expenses over the estimated useful life of the asset in a systematic and rational manner. Depreciation for the year is the amount of the allocation or distribution for the year involved.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipeds_natural_expense( Ref_IPEDS_Natural_Expense_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'Interest', 'Interest', 'The price paid (or received) for the use of money over a period of time. Interest income is one component of investment income. Interest paid by the institution is interest expense.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipeds_natural_expense( Ref_IPEDS_Natural_Expense_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 4, 'Operation and maintenance of plant', 'Operationmaintenanceofplant', 'An expense category that includes expenses for operations established to provide service and maintenance related to campus grounds and facilities used for educational and general purposes. Specific expenses include utilities, fire protection, property insurance, and similar items. This expense does include amounts charged to auxiliary enterprises, hospitals, and independent operations. Also includes information technology expenses related to operation and maintenance of plant activities if the institution separately budgets and expenses information technology resources (otherwise these expenses are included in institutional support).', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipeds_natural_expense( Ref_IPEDS_Natural_Expense_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 5, 'Other', 'Other', null, null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipeds_natural_expense( Ref_IPEDS_Natural_Expense_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 6, 'Salaries and wages', 'Salarieswages', 'Amounts paid as compensation for services to all employees - faculty, staff, part-time, full-time, regular employees, and student employees. This includes regular or periodic payment to a person for the regular or periodic performance of work or a service and payment to a person for more sporadic performance of work or a service (overtime, extra compensation, summer compensation, bonuses, sick or annual leave, etc.).', null, null ); 
