INSERT INTO rs_ceds7_sc.ref_ipedsfasb_functional_expense( Ref_IPEDSFASB_Functional_Expense_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Academic support', 'Academicsupport', 'A functional expense category that includes expenses of activities and services that support the institution''s primary missions of instruction, research, and public service. It includes the retention, preservation, and display of educational materials (for example, libraries, museums, and galleries); organized activities that provide support services to the academic functions of the institution (such as a demonstration school associated with a college of education or veterinary and dental clinics if their primary purpose is to support the instructional program); media such as audiovisual services; academic administration (including academic deans but not department chairpersons); and formally organized and separately budgeted academic personnel development and course and curriculum development expenses. Also included are information technology expenses related to academic support activities; if an institution does not separately budget and expense information technology resources, the costs associated with the three primary programs will be applied to this function and the remainder to institutional support. Institutions include actual or allocated costs for operation and maintenance of plant, interest, and depreciation.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_functional_expense( Ref_IPEDSFASB_Functional_Expense_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Auxiliary enterprises', 'Auxiliaryenterprises', 'Expenses for essentially self-supporting operations of the institution that exist to furnish a service to students, faculty, or staff, and that charge a fee that is directly related to, although not necessarily equal to, the cost of the service. Examples are residence halls, food services, student health services, intercollegiate athletics (only if essentially self-supporting), college unions, college stores, faculty and staff parking, and faculty housing. Institutions include actual or allocated costs for operation and maintenance of plant, interest and depreciation.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_functional_expense( Ref_IPEDSFASB_Functional_Expense_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'Hospital services', 'Hospitalservices', 'Expenses associated with a hospital operated by the postsecondary institution (but not as a component unit) and reported as a part of the institution. This classification includes nursing expenses, other professional services, general services, administrative services, and fiscal services. Also included are information technology expenses, actual or allocated costs for operation and maintenance of plant, interest and depreciation related to hospital capital assets.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_functional_expense( Ref_IPEDSFASB_Functional_Expense_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 4, 'Independent operations', 'Independentoperations', 'Expenses associated with operations that are independent of or unrelated to the primary missions of the institution (i.e., instruction, research, public service) although they may contribute indirectly to the enhancement of these programs. This category is generally limited to expenses of a major federally funded research and development center. Also includes information technology expenses, actual or allocated costs for operation and maintenance of plant, interest and depreciation related to the independent operations. Expenses of operations owned and managed as investments of the institution''s endowment funds are excluded.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_functional_expense( Ref_IPEDSFASB_Functional_Expense_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 5, 'Institutional support', 'Institutionalsupport', 'A functional expense category that includes expenses for the day-to-day operational support of the institution. Includes expenses for general administrative services, central executive-level activities concerned with management and long range planning, legal and fiscal operations, space management, employee personnel and records, logistical services such as purchasing and printing, and public relations and development. Also includes information technology expenses related to institutional support activities. If an institution does not separately budget and expense information technology resources, the IT costs associated with student services and operation and maintenance of plant will also be applied to this function.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_functional_expense( Ref_IPEDSFASB_Functional_Expense_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 6, 'Instruction', 'Instruction', 'A functional expense category that includes expenses of the colleges, schools, departments, and other instructional divisions of the institution and expenses for departmental research and public service that are not separately budgeted. Includes general academic instruction, occupational and vocational instruction, community education, preparatory and adult basic education, and regular, special, and extension sessions. Also includes expenses for both credit and non-credit activities. Excludes expenses for academic administration where the primary function is administration (e.g., academic deans). Information technology expenses related to instructional activities if the institution separately budgets and expenses information technology resources are included (otherwise these expenses are included in academic support). Institutions include actual or allocated costs for operation and maintenance of plant, interest, and depreciation.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_functional_expense( Ref_IPEDSFASB_Functional_Expense_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 7, 'Net grant aid to students', 'Netgrantaidtostudents', 'The portion of scholarships and fellowships granted by an institution that exceeds the amount applied to institutional charges such as tuition and fees or room and board. The amount reported as expense excludes allowances.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_functional_expense( Ref_IPEDSFASB_Functional_Expense_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 8, 'Other', 'Other', null, null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_functional_expense( Ref_IPEDSFASB_Functional_Expense_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 9, 'Public service', 'Publicservice', 'A functional expense category that includes expenses for activities established primarily to provide noninstructional services beneficial to individuals and groups external to the institution. Examples are conferences, institutes, general advisory service, reference bureaus, and similar services provided to particular sectors of the community. This function includes expenses for community services, cooperative extension services, and public broadcasting services. Also includes information technology expenses related to the public service activities if the institution separately budgets and expenses information technology resources (otherwise these expenses are included in academic support). Institutions include actual or allocated costs for operation and maintenance of plant, interest, and depreciation.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_functional_expense( Ref_IPEDSFASB_Functional_Expense_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 10, 'Research', 'Research', 'A functional expense category that includes expenses for activities specifically organized to produce research outcomes and commissioned by an agency either external to the institution or separately budgeted by an organizational unit within the institution. The category includes institutes and research centers, and individual and project research. This function does not include nonresearch sponsored programs (e.g., training programs). Also included are information technology expenses related to research activities if the institution separately budgets and expenses information technology resources (otherwise these expenses are included in academic support.) Institutions include actual or allocated costs for operation and maintenance of plant, interest, and depreciation.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_functional_expense( Ref_IPEDSFASB_Functional_Expense_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 11, 'Student services', 'Studentservices', 'A functional expense category that includes expenses for admissions, registrar activities, and activities whose primary purpose is to contribute to students emotional and physical well-being and to their intellectual, cultural, and social development outside the context of the formal instructional program. Examples include student activities, cultural events, student newspapers, intramural athletics, student organizations, supplemental instruction outside the normal administration, and student records. Intercollegiate athletics and student health services may also be included except when operated as self-supporting auxiliary enterprises. Also may include information technology expenses related to student service activities if the institution separately budgets and expenses information technology resources(otherwise these expenses are included in institutional support.) Institutions include actual or allocated costs for operation and maintenance of plant, interest, and depreciation.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_revenue( Ref_IPEDSFASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Contributions from affiliated entities', 'Contributionsfromaffiliatedentities', 'Used for reporting all revenues received from non-consolidated affiliated entities, such as fund raising foundations, booster clubs, other institutionally-related foundations, and similar organizations created to support the institution or organizational components of the institution.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_revenue( Ref_IPEDSFASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Federal appropriations', 'Federalappropriations', 'Used for reporting all amounts received from the federal government through a direct appropriation of Congress, except grants and contracts. An example of a federal appropriation is a federal land-grant appropriation. Does not include Pell Grants or any ARRA revenues.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_revenue( Ref_IPEDSFASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'Federal grants and contracts', 'Federalgrantscontracts', 'Used for reporting all revenues from federal agencies that are for specific undertakings such as research projects, training projects, and similar activities, including contributions from federal agencies. If federal Pell and similar student aid grants are treated as agency transactions in your GPFS, they are excluded from this amount. If federal Pell and similar student aid grants are treated as student aid expenses or as allowances when awarded, they are included from this amount. Does not include any ARRA revenues.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_revenue( Ref_IPEDSFASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 4, 'Hospital revenue (not to be reported by less-than-4-year institutions)', 'Hospitalrevenuenottobereportedby', 'Used for reporting the amount of revenues generated by the auxiliary enterprise operations, net of any allowances applied in the general purpose financial statements. Auxiliary enterprises are operations that exist to furnish a service to students, faculty, or staff, and that charge a fee that is directly related to the cost of the service. Examples are residence halls, food services, student health services, intercollegiate athletics, college unions, college stores, and movie theaters.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_revenue( Ref_IPEDSFASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 5, 'Independent operations revenue (not to be reported by less-than-4-year institutions)', 'Independentoperationsrevenuenottobe', 'Used for reporting the revenues and gains of hospitals operated as a component of a reporting institution of higher education. If your hospital is reporting in IPEDS educational program activity that is conducted separate from an institution of higher education, they are excluded from this amount.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_revenue( Ref_IPEDSFASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 6, 'Investment return', 'Investmentreturn', 'Used for reporting all investment income (i.e., interest, dividends, rents and royalties), gains and losses (realized and unrealized) from holding investments (regardless of the nature of the investment), student loan interest, and amounts distributed from irrevocable trusts held by others (collectively referred to as investment return). Changes in the value of interest rate swaps should be included in this amount.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_revenue( Ref_IPEDSFASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 7, 'Local appropriations', 'Localappropriations', 'Used for reporting all amounts received from a local government (i.e., city and/or county) through a direct appropriation of its legislative body, except for local grants and contracts. An example of a local appropriation is an annual local appropriation for operating expenses of the institution.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_revenue( Ref_IPEDSFASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 8, 'Local grants and contracts', 'Localgrantscontracts', 'Used for reporting all revenues from local government agencies that are for specific undertakings such as research projects, training projects, and similar activities, including contributions from local agencies. If local grants for student aid are treated as agency transactions in your GPFS, they are excluded from this amount. If local grants for student aid are treated in your GPFS as student aid expenses or as allowances when awarded, they are included from this amount.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_revenue( Ref_IPEDSFASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 9, 'Net assets released from restriction', 'Netassetsreleasedfromrestriction', 'Includes all other revenue not reported elsewhere.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_revenue( Ref_IPEDSFASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 10, 'Other revenue', 'Otherrevenue', 'Used for reporting all revenues associated with operations independent of the primary missions of the institution. This category generally includes only those revenues associated with major federally-funded research and development centers. Does not include the profit (or loss) from operations owned and managed as investments of the institution?s endowment funds.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_revenue( Ref_IPEDSFASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 11, 'Private gifts', 'Privategifts', 'Used for reporting revenues from private (non-governmental) entities including revenues received from gift or contribution nonexchange transactions (including contributed services) except those from affiliated entities. Includes bequests, promises to give (pledges), gifts from an affiliated organization or a component unit not blended or consolidated, and income from funds held in irrevocable trusts or distributable at the direction of the trustees of the trusts. Includes any contributed services recognized (recorded) by the institution.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_revenue( Ref_IPEDSFASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 12, 'Private grants and contracts', 'Privategrantscontracts', 'Used for reporting revenues from private (non-governmental) entities that are for specific research projects, other types of programs, or for general institutional operations (if not government appropriations). Examples are research projects, training programs, and similar activities for which amounts are received or expenses are reimbursable under the terms of a grant or contract, including amounts to cover both direct and indirect expenses.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_revenue( Ref_IPEDSFASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 13, 'Sales and services of auxiliary enterprises (net of allowance)', 'Salesservicesofauxiliaryenterprisesnetofallowance', 'Used for reporting the amount of revenues generated by the auxiliary enterprise operations, net of any allowances applied in the general purpose financial statements. Auxiliary enterprises are operations that exist to furnish a service to students, faculty, or staff, and that charge a fee that is directly related to the cost of the service. Examples are residence halls, food services, student health services, intercollegiate athletics, college unions, college stores, and movie theaters.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_revenue( Ref_IPEDSFASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 14, 'Sales and services of educational activities', 'Salesservicesofeducationalactivities', 'Used for reporting all revenues derived from the sales of goods or services that are incidental to the conduct of instruction, research or public service, and revenues of activities that exist to provide instructional and laboratory experience for students and that incidentally create goods and services that may be sold. Examples include film rentals, scientific and literary publications, testing services, university presses, dairies, and patient care clinics that are not part of a hospital.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_revenue( Ref_IPEDSFASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 15, 'State appropriations', 'Stateappropriations', 'Used for reporting all amounts received from a state government through a direct appropriation of its legislative body, except for state grants and contracts. An example of a state appropriation is an annual state appropriation for operating expenses of the institution. (FARM para. 463) Does not include any ARRA revenues.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_revenue( Ref_IPEDSFASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 16, 'State grants and contracts', 'Stategrantscontracts', 'Used for reporting all revenues from state government agencies that are for specific undertakings such as research projects, training projects, and similar activities, including contributions from state agencies. If state grants for student aid are treated as agency transactions in your GPFS, they are excluded from this amount. If state grants for student aid are treated in your GPFS as student aid expenses or as allowances when awarded, include the grant revenue on this line and in Part C. Does not include any ARRA revenues.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_revenue( Ref_IPEDSFASB_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 17, 'Tuition and fees (net of allowance)', 'Tuitionfeesnetofallowance', 'Used for reporting the amount of tuition and educational fees, net of any allowances applied in the GPFS. Include in this amount all fees for continuing education programs, conferences, and seminars.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_scholarshipsand_fellowships_revenue( Ref_IPEDSFASB_Scholarshipsand_Fellowships_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Discounts and allowances applied to auxiliary enterprise revenues', 'Discountsallowancesappliedtoauxiliary', 'The amount of allowances (scholarships) applied to auxiliary enterprise revenues (e.g., dormitory charges).', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_scholarshipsand_fellowships_revenue( Ref_IPEDSFASB_Scholarshipsand_Fellowships_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Discounts and allowances applied to tuition and fees', 'Discountsallowancesappliedtotuitionfees', 'The amount of allowances (scholarships) applied to tuition and fees.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_scholarshipsand_fellowships_revenue( Ref_IPEDSFASB_Scholarshipsand_Fellowships_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'Grants by local government', 'Grantsbylocalgovernment', 'Local government grants include scholarships or gift-aid awarded directly to the student.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_scholarshipsand_fellowships_revenue( Ref_IPEDSFASB_Scholarshipsand_Fellowships_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 4, 'Grants by state government', 'Grantsbystategovernment', 'Grant monies provided by the state such as Leveraging Educational Assistance Partnerships (LEAP) (formerly SSIG''s); merit scholarships provided by the state; and tuition and fee waivers for which the institution was reimbursed by a state agency.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_scholarshipsand_fellowships_revenue( Ref_IPEDSFASB_Scholarshipsand_Fellowships_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 5, 'Institutional grants (restricted)', 'Institutionalgrantsrestricted', 'Scholarships and fellowships awarded to students from institutional resources that are restricted to student aid. Private institutions generally report these grants as allowances. If control over these resources passes to the student, the amount is reported as an expense.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_scholarshipsand_fellowships_revenue( Ref_IPEDSFASB_Scholarshipsand_Fellowships_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 6, 'Institutional grants (unrestricted)', 'Institutionalgrantsunrestricted', 'Scholarships and fellowships awarded to students from unrestricted institutional resources. Private institutions generally report these grants as allowances. If control over these resources passes to the student, the amount is reported as an expense.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_scholarshipsand_fellowships_revenue( Ref_IPEDSFASB_Scholarshipsand_Fellowships_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 7, 'Other federal grants', 'Otherfederalgrants', 'Federal monies awarded to the institution under federal government student aid programs, such as the Federal Supplemental Educational Opportunity Grants (FSEOG), DHHS training grants (aid portion only), the Leveraging Education Assistance Partnership (LEAP) program, and other federal student aid programs. Pell Grants are not included in this classification. Note: if the federal government selects the student recipients and simply transmits the funds to the institution for disbursement to the student, the amounts are not considered as revenues and subsequently there are no discounts and allowances or scholarships and fellowships expenses. If the funds are made available to the institution for selection of student recipients, then the amounts received are considered as nonoperating revenues and subsequently as discounts and allowances or scholarships and fellowships expenses.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsfasb_scholarshipsand_fellowships_revenue( Ref_IPEDSFASB_Scholarshipsand_Fellowships_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 8, 'Pell grants', 'Pellgrants', 'The gross amount of Pell Grants made available to recipients by your institution. This is the gross Pell Grants received as federal grant revenue for the fiscal year.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsgasb_functional_expense( Ref_IPEDSGASB_Functional_Expense_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Instruction', 'Instruction', 'A functional expense category that includes expenses of the colleges, schools, departments, and other instructional divisions of the institution and expenses for departmental research and public service that are not separately budgeted. Includes general academic instruction, occupational and vocational instruction, community education, preparatory and adult basic education, and regular, special, and extension sessions. Also includes expenses for both credit and non-credit activities. Excludes expenses for academic administration where the primary function is administration (e.g., academic deans). Information technology expenses related to instructional activities if the institution separately budgets and expenses information technology resources are included (otherwise these expenses are included in academic support). Institutions include actual or allocated costs for operation and maintenance of plant, interest, and depreciation.', null, 1.00 ); 
INSERT INTO rs_ceds7_sc.ref_ipedsgasb_functional_expense( Ref_IPEDSGASB_Functional_Expense_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Research', 'Research', 'A functional expense category that includes expenses for activities specifically organized to produce research outcomes and commissioned by an agency either external to the institution or separately budgeted by an organizational unit within the institution. The category includes institutes and research centers, and individual and project research. This function does not include nonresearch sponsored programs (e.g., training programs). Also included are information technology expenses related to research activities if the institution separately budgets and expenses information technology resources (otherwise these expenses are included in academic support.) Institutions include actual or allocated costs for operation and maintenance of plant, interest, and depreciation.', null, 2.00 ); 
INSERT INTO rs_ceds7_sc.ref_ipedsgasb_functional_expense( Ref_IPEDSGASB_Functional_Expense_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'Public service', 'Publicservice', 'A functional expense category that includes expenses for activities established primarily to provide noninstructional services beneficial to individuals and groups external to the institution. Examples are conferences, institutes, general advisory service, reference bureaus, and similar services provided to particular sectors of the community. This function includes expenses for community services, cooperative extension services, and public broadcasting services. Also includes information technology expenses related to the public service activities if the institution separately budgets and expenses information technology resources (otherwise these expenses are included in academic support). Institutions include actual or allocated costs for operation and maintenance of plant, interest, and depreciation.', null, 3.00 ); 
INSERT INTO rs_ceds7_sc.ref_ipedsgasb_functional_expense( Ref_IPEDSGASB_Functional_Expense_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 4, 'Academic support', 'Academicsupport', 'A functional expense category that includes expenses of activities and services that support the institution''s primary missions of instruction, research, and public service. It includes the retention, preservation, and display of educational materials (for example, libraries, museums, and galleries); organized activities that provide support services to the academic functions of the institution (such as a demonstration school associated with a college of education or veterinary and dental clinics if their primary purpose is to support the instructional program); media such as audiovisual services; academic administration (including academic deans but not department chairpersons); and formally organized and separately budgeted academic personnel development and course and curriculum development expenses. Also included are information technology expenses related to academic support activities; if an institution does not separately budget and expense information technology resources, the costs associated with the three primary programs will be applied to this function and the remainder to institutional support. Institutions include actual or allocated costs for operation and maintenance of plant, interest, and depreciation.', null, 4.00 ); 
INSERT INTO rs_ceds7_sc.ref_ipedsgasb_functional_expense( Ref_IPEDSGASB_Functional_Expense_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 5, 'Student services', 'Studentservices', 'A functional expense category that includes expenses for admissions, registrar activities, and activities whose primary purpose is to contribute to students emotional and physical well-being and to their intellectual, cultural, and social development outside the context of the formal instructional program. Examples include student activities, cultural events, student newspapers, intramural athletics, student organizations, supplemental instruction outside the normal administration, and student records. Intercollegiate athletics and student health services may also be included except when operated as self-supporting auxiliary enterprises. Also may include information technology expenses related to student service activities if the institution separately budgets and expenses information technology resources(otherwise these expenses are included in institutional support.) Institutions include actual or allocated costs for operation and maintenance of plant, interest, and depreciation.', null, 5.00 ); 
INSERT INTO rs_ceds7_sc.ref_ipedsgasb_functional_expense( Ref_IPEDSGASB_Functional_Expense_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 6, 'Institutional support', 'Institutionalsupport', 'A functional expense category that includes expenses for the day-to-day operational support of the institution. Includes expenses for general administrative services, central executive-level activities concerned with management and long range planning, legal and fiscal operations, space management, employee personnel and records, logistical services such as purchasing and printing, and public relations and development. Also includes information technology expenses related to institutional support activities. If an institution does not separately budget and expense information technology resources, the IT costs associated with student services and operation and maintenance of plant will also be applied to this function.', null, 6.00 ); 
INSERT INTO rs_ceds7_sc.ref_ipedsgasb_functional_expense( Ref_IPEDSGASB_Functional_Expense_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 7, 'Auxiliary enterprises', 'Auxiliaryenterprises', 'Expenses for essentially self-supporting operations of the institution that exist to furnish a service to students, faculty, or staff, and that charge a fee that is directly related to, although not necessarily equal to, the cost of the service. Examples are residence halls, food services, student health services, intercollegiate athletics (only if essentially self-supporting), college unions, college stores, faculty and staff parking, and faculty housing. Institutions include actual or allocated costs for operation and maintenance of plant, interest and depreciation.', null, 7.00 ); 
INSERT INTO rs_ceds7_sc.ref_ipedsgasb_functional_expense( Ref_IPEDSGASB_Functional_Expense_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 8, 'Scholarships and fellowships', 'Scholarshipsfellowships', 'That portion of scholarships and fellowships granted that exceeds the amount applied to institutional charges such as tuition and fees or room and board. The amount reported as expense excludes allowances and discounts. The FASB survey uses the term net grants in aid to students rather than scholarships and fellowships.', null, 8.00 ); 
INSERT INTO rs_ceds7_sc.ref_ipedsgasb_functional_expense( Ref_IPEDSGASB_Functional_Expense_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 9, 'Hospital services', 'Hospitalservices', 'Expenses associated with a hospital operated by the postsecondary institution (but not as a component unit) and reported as a part of the institution. This classification includes nursing expenses, other professional services, general services, administrative services, and fiscal services. Also included are information technology expenses, actual or allocated costs for operation and maintenance of plant, interest and depreciation related to hospital capital assets.', null, 9.00 ); 
INSERT INTO rs_ceds7_sc.ref_ipedsgasb_functional_expense( Ref_IPEDSGASB_Functional_Expense_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 10, 'Independent operations', 'Independentoperations', 'Expenses associated with operations that are independent of or unrelated to the primary missions of the institution (i.e., instruction, research, public service) although they may contribute indirectly to the enhancement of these programs. This category is generally limited to expenses of a major federally funded research and development center. Also includes information technology expenses, actual or allocated costs for operation and maintenance of plant, interest and depreciation related to the independent operations. Expenses of operations owned and managed as investments of the institution''s endowment funds are excluded.', null, 10.00 ); 
INSERT INTO rs_ceds7_sc.ref_ipedsgasb_functional_expense( Ref_IPEDSGASB_Functional_Expense_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 11, 'Other', 'Other', null, null, 99.00 ); 
INSERT INTO rs_ceds7_sc.ref_ipedsgasb_scholarshipsand_fellowships_revenue( Ref_IPEDSGASB_Scholarshipsand_Fellowships_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 1, 'Discounts & allowances applied to sales & services of auxiliary enterprises', 'Discountsallowancesappliedtosalesservices', 'The amount of discounts & allowances that were recorded as an offset (reduction) to revenues of auxiliary enterprises (room and board, books, meals, etc.).', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsgasb_scholarshipsand_fellowships_revenue( Ref_IPEDSGASB_Scholarshipsand_Fellowships_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 2, 'Discounts & allowances applied to tuition & fees', 'Discountsallowancesappliedtotuitionfees', 'The amount of discounts & allowances that were recorded as an offset (reduction) to student tuition & fees.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsgasb_scholarshipsand_fellowships_revenue( Ref_IPEDSGASB_Scholarshipsand_Fellowships_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 3, 'Grants by local government', 'Grantsbylocalgovernment', 'Local government grants include scholarships or gift-aid awarded directly to the student.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsgasb_scholarshipsand_fellowships_revenue( Ref_IPEDSGASB_Scholarshipsand_Fellowships_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 4, 'Grants by state government', 'Grantsbystategovernment', 'Grant monies provided by the state such as Leveraging Educational Assistance Partnerships (LEAP) (formerly SSIG''s); merit scholarships provided by the state; and tuition and fee waivers for which the institution was reimbursed by a state agency.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsgasb_scholarshipsand_fellowships_revenue( Ref_IPEDSGASB_Scholarshipsand_Fellowships_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 5, 'Institutional grants from restricted resources', 'Institutionalgrantsfromrestrictedresources', 'Institutional grants to students funded from restricted-expendable resources for student aid, such as scholarships and fellowships.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsgasb_scholarshipsand_fellowships_revenue( Ref_IPEDSGASB_Scholarshipsand_Fellowships_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 6, 'Institutional grants from unrestricted resources', 'Institutionalgrantsfromunrestrictedresources', 'Institutional grants to students that are funded from resources that are not restricted to any particular purpose.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsgasb_scholarshipsand_fellowships_revenue( Ref_IPEDSGASB_Scholarshipsand_Fellowships_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 7, 'Other federal grants', 'Otherfederalgrants', 'Federal monies awarded to the institution under federal government student aid programs, such as the Federal Supplemental Educational Opportunity Grants (FSEOG), DHHS training grants (aid portion only), the Leveraging Education Assistance Partnership (LEAP) program, and other federal student aid programs. Pell Grants are not included in this classification. Note: if the federal government selects the student recipients and simply transmits the funds to the institution for disbursement to the student, the amounts are not considered as revenues and subsequently there are no discounts and allowances or scholarships and fellowships expenses. If the funds are made available to the institution for selection of student recipients, then the amounts received are considered as nonoperating revenues and subsequently as discounts and allowances or scholarships and fellowships expenses.', null, null ); 
INSERT INTO rs_ceds7_sc.ref_ipedsgasb_scholarshipsand_fellowships_revenue( Ref_IPEDSGASB_Scholarshipsand_Fellowships_Revenue_Id, Description, Code, Definition, Ref_Jurisdiction_Id, Sort_Order ) VALUES ( 8, 'Pell grants', 'Pellgrants', 'The gross amount of Pell Grants made available to recipients by your institution. This is the gross Pell Grants received as federal grant revenue for the fiscal year.', null, null ); 
